IWCYB appreciation time! First, thank you all so much for listening this last week and going on this folky journey with me. I recorded everything except the vocals to this song back in 2015, so it feels amazing to finally release it. Second, I gotta thank the amazing team that worked on this song and many of the others I have coming this year:

@danknobler co-produced everything and is such a 💎, plus he played banjo on this tune 🪕 
@jburgerdrums is my drummer and was integral to the sound of this record
@everydayimruslyn for the gorgeous fiddling :)
@katedavismusic and @bbonj for the dulcet background vocals 😍
@alecspiegelman for the flute and clarinet! 
@greasebradley for the incredible mix
@miketuccillo for mastering the heck of it
@benjybradshaw for the gorg photo
@annavoloshyn for the perfect graphic design 
@elliotjacobson2.0 my fearless manager who has been with me truly “through the thick and through the thin”

I’m sure there are others I’m forgetting, but I love you all!!!

This new one dropped yesterday! Thanks to everyone who’s already listened. This one is about my early gay days dating in NYC. Let me know if you can relate 😅

Recorded way way back, but here are some of the folks I gotta thank:

@danknobler for guitar / co-production
@jburgerdrums on drums / perc
@johnfcardoza for background vox
@burritosinspace for mix
@miketuccillo for master
@annavoloshyn for artwork

And many more!!
